import React, { useState } from "react";

const Logout = () => {
  const [checked, setChecked] = useState(false);
  return (
    <div className="logoutContainer">
      <label className="switch">
        <input type="checkbox" />
        <span className="slider round"></span>
      </label>
    </div>
  );
};

export default Logout;
